import logo from "../../assets/img/logo.png";
import styled from "styled-components";

const Box = styled.div`
  width: 20%;
  height: 150px;
  background-color: blue;
`;

function Logo(params) {
  return (
    <Box>
      <img src={logo} />
    </Box>
  );
}
export default Logo;
